import React from 'react';
import './PrimaryButton.scss';
import { Link } from 'react-router-dom';

function PrimaryButton({prop }){
    return isLink?(
        <Link className='primary-button' to={prop.link}>
            <img src={prop.icon} alt="Button icon" className={`primary-button__icon brainflix_icon_button ${iconOption}`}  />
            <p className='primary-button__text'>{prop.text}</p>
        </Link>
    ): (
        <button className='primary-button' id={prop.bntId}>
            <img src={prop.icon} alt="Button icon" className={`primary-button__icon brainflix_icon_button ${prop.iconOption}`}  />
            <p className='primary-button__text'>{prop.text}</p>
        </button>
    );
}

export default PrimaryButton;
